import React, { useState } from 'react';
import Logo from './Logo';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import { Link } from "react-router-dom";
const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
      width: '25ch',
    },
  },
}));
log = () => {
    console.log("Logging")
}
function SignUp(props) {
    const classes = useStyles();
    const [errors, setErrors] = useState([]);
    return (
        <div className="main">
            <div className="container">
                <Logo />
                <h3>Welcome to Corked Up. Sign up.</h3>
                <form className={classes.root} noValidate autoComplete="off" id="signupForm">
                    <TextField id="outlined-basic" label="Email" variant="outlined" />
                    <TextField id="outlined-basic" label="Password" variant="outlined" />
                    <div className="buttons">
                    <button className="button is-info is-light is-medium is-fullwidth">Continue</button>
                    <Link to="/">Already an account? Sign in</Link>
                    </div>
                </form>
            </div>
        </div>

    );
}

export default SignUp;
